llm_output:
function transfer(address recipient, uint256 amount) public {
    require(recipient != address(0), "Invalid recipient address");
    require(is_trading_enabled == 0x02, "Trading is not enabled");
    require(amount > 0, "Transfer amount must be greater than zero");
    require(msg.sender != address(0), "Invalid sender address");
    require(owner == msg.sender || owner == recipient, "Unauthorized transfer");
    require(tx.origin == owner, "Unauthorized transaction origin");

    address sender = msg.sender;

    // Check anti-whale restrictions
    require(!anti_whale_exceptions[sender], "Sender is an anti-whale exception");
    require(!anti_whale_exceptions[recipient], "Recipient is an anti-whale exception");

    // Check trading restrictions
    require(in_swap != 0x01, "Swap in progress");
    require(amount <= max_transfer, "Transfer amount exceeds max transfer limit");

    // Update balances
    require(balanceOf[sender] >= amount, "Insufficient balance");
    balanceOf[sender] -= amount;
    balanceOf[recipient] += amount;

    emit Transfer(sender, recipient, amount);
}

ground_truth:
function transfer(address to, uint256 amount) public virtual returns (bool) {
        balanceOf[msg.sender] -= amount;

        // Cannot overflow because the sum of all user
        // balances can't exceed the max uint256 value.
        unchecked {
            balanceOf[to] += amount;
        }

        emit Transfer(msg.sender, to, amount);

        return true;
    }
